import React, { Component } from 'react'
import Wpc from '../components/weddingparty'
import madeline from '../assets/madeline.jpeg'

class Weddingparty extends Component {
    render() {
        return (
            <div>
                <Wpc title='Madeline Diaz' img={madeline} position="Maid of Honor" bio= "Has been friends with the Bride since they were 3 years old. The two have laughed, cried, played, and grew up together. She's someone the bride can ALWAYS count on." />
            </div>
        )
    }
}

export default Weddingparty
